const { Fragment } = require("react");

const App = () => {
  return (
    <Fragment>
      <h1>Hello World!</h1>
      <Link href={`/profile?slug=`}>
        <a>Profile</a>
      </Link>
    </Fragment>
  );
};

export default App;
